// Normalize incoming events from different channels into unified schema
const item = $input.item.json;

// Generate unique event ID if not present
const eventId = item.eventId || item.id || `evt_${Date.now()}_${Math.random().toString(36).substr(2, 9)}`;

// Extract timestamp (try multiple common fields)
const timestamp = item.timestamp || item.createdAt || item.created_at || item.time || new Date().toISOString();

// Detect and normalize channel
let channel = item.channel || item.source || 'unknown';
if (item.from && item.from.includes('@')) channel = 'email';
if (item.phoneNumber || item.callSid) channel = 'voice';
if (item.chatId || item.conversationId) channel = 'chat';
if (item.crmSource || item.salesforceId || item.hubspotId) channel = 'crm';
if (item.deviceId || item.telemetryType) channel = 'telemetry';

// Extract user and customer identifiers
const userId = item.userId || item.user_id || item.agentId || item.from || null;
const customerId = item.customerId || item.customer_id || item.contactId || item.contact_id || item.leadId || item.email || item.phoneNumber || null;

// Determine event type
const eventType = item.eventType || item.event_type || item.type || item.action || 'interaction';

// Extract payload (main event data)
const payload = item.payload || item.data || item.body || item.content || {
  message: item.message || item.text || item.description,
  subject: item.subject,
  priority: item.priority,
  tags: item.tags || [],
  ...item
};

// Extract metadata
const metadata = item.metadata || {
  originalSource: item.source,
  ipAddress: item.ipAddress || item.ip,
  userAgent: item.userAgent || item.user_agent,
  sessionId: item.sessionId || item.session_id,
  referrer: item.referrer,
  campaign: item.campaign || item.utm_campaign,
  medium: item.medium || item.utm_medium,
  rawData: item
};

// Return normalized event
return {
  json: {
    eventId,
    timestamp,
    channel,
    userId,
    customerId,
    eventType,
    payload,
    metadata
  }
};

