// Calculate Priority Score based on multiple factors
const item = $input.item.json;

// Extract scores from the enriched data
const churnRiskScore = item.churnRiskScore || 0;
const purchaseReadinessScore = item.purchaseReadinessScore || 0;
const sentimentScore = item.sentimentScore || 0;
const intentUrgency = item.intentUrgency || 'low';

// Map intent urgency to numeric value
const urgencyMap = {
  'critical': 100,
  'high': 75,
  'medium': 50,
  'low': 25
};
const urgencyValue = urgencyMap[intentUrgency.toLowerCase()] || 25;

// Calculate weighted priority score (0-100)
const priorityScore = (
  (churnRiskScore * 0.3) +
  (purchaseReadinessScore * 0.3) +
  (sentimentScore * 0.2) +
  (urgencyValue * 0.2)
);

// Determine priority level
let priorityLevel;
if (priorityScore >= 80) {
  priorityLevel = 'critical';
} else if (priorityScore >= 60) {
  priorityLevel = 'high';
} else if (priorityScore >= 40) {
  priorityLevel = 'medium';
} else {
  priorityLevel = 'low';
}

// Return enriched item with priority data
return {
  ...item,
  priorityScore: Math.round(priorityScore * 100) / 100,
  priorityLevel: priorityLevel,
  priorityCalculatedAt: new Date().toISOString()
};

